import React from 'react'

const UserCard = props => {

        return (
            <div>

                <img src= {props.avatar}/>
                <p>Location: {props.location}</p>
                <p>Followers: {props.followers}</p>
                <p>Following:{props.following}</p>
            </div>
        )
}

export default UserCard
